import React from "react";

export default function Content() {
  const [pageIndex, setPageIndex] = useState(0);
  {
    switch (pageIndex) {
      case 0:
        return <h1>0</h1>;
        break;
      case 1:
        return <h1>0</h1>;
        break;
      default:
        return <h1>0</h1>;

        break;
    }
  }
  return <div></div>;
}
